import logo from './img/Unofficial_JavaScript_logo_2.svg.png'
import './App.css';
import 'animate.css'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo, animate__heartBeat, animate__heartBeat" alt="logo" />
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn Java Script
        </a>
      </header>
    </div>
  );
}

export default App;
